import { BrowserRouter,Route, Routes} from 'react-router-dom'
import './App.css';
import Header from './components/Header';
import Post from './components/post';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route index element={
   <main>
   <Header />
    <Post />
    <Post />
    <Post /> 

   </main>
   } />
   <Route path='/login' element={
    <div>login</div> 
   } />
   </Routes>
   </BrowserRouter>
  );
}

export default App;
